import React from "react";

const base64String = ``;

const base64ToPDF = (base64String) => {
  // Decode base64 string
  const decodedData = atob(base64String);

  // Convert decoded data to array buffer
  const arrayBuffer = new ArrayBuffer(decodedData.length);
  const uint8Array = new Uint8Array(arrayBuffer);
  for (let i = 0; i < decodedData.length; i++) {
    uint8Array[i] = decodedData.charCodeAt(i);
  }

  // Create Blob from array buffer
  const blob = new Blob([arrayBuffer], { type: "application/pdf" });

  // Create a data URL from the Blob
  const dataUrl = URL.createObjectURL(blob);

  // Open a new window with the data URL
  const newWindow = window.open(dataUrl, "_blank");

  // Print the opened window
  newWindow.onload = function () {
    newWindow.print();
  };
};

const HangHoa = () => {
  return (
    <div>
      <button onClick={() => base64ToPDF(base64String)}>
        iAAAAAAAAAAAAAAAAAAAAAAAA
      </button>
    </div>
  );
};

export default HangHoa;
